import React, { Component } from 'react';

class Blognav extends React.Component {
    render() { 
        return (
        <div>
            
                 <a onClick={this.mlShow} href="#">ML</a>&nbsp
                 <a onClick={this.iotShow} href="#">IOT</a>
                 <a onClick={this.webShow} href="#">WEB</a>
            
        </div>
        );
    }
}
 
export default Blognav;
